"212588":{"id":"212588","name":"A Fúria de Paris","slug":"a-furia-de-paris","original_title":"Furies","overview":"Buscando vingar a morte do pai, uma jovem se envolve com Fúria, a justiceira do submundo do crime em Paris.","first_air_date":"2024-03-01","episode_run_time":0,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Yoann Legave","Jean-Yves Arnaud"],"production_companies":["Daïmôn Films","Empreinte Digitale"],"genres":["Action & Adventure","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/lOM5ho8qmqQh0F6cn1DxGB61RvR.jpg","poster_path":"https://image.tmdb.org/t/p/original/evaMWqg2TbIs9neUW0YS1gLV4eX.jpg","cast":["Mathieu Kassovitz","Fatima Adoum","Marina Foïs","Lina El Arabi","Steve Tientcheu"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/gbBqR7NPF9j0XVAdgsxP7kSweDi.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gbBqR7NPF9j0XVAdgsxP7kSweDi.jpg","air_date":"2024-03-01","episode_count":8,"overview":"N/A","vote_average":7.7,"episodes":{"1":{"name":"Eu trabalho pra ela","overview":"Jurando vingar o pai depois que seu aniversário virou um banho de sangue, Lyna chega perto da pessoa que ela considera responsável pela morte: a Fúria.","air_date":"2024-03-01","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/mZBzfuPKWJ41Ko1dJGKoEAoq7nx.jpg","vote_average":9},"2":{"name":"Um coração partido é melhor do que uma bala na cabeça","overview":"Com a polícia na sua cola, a primeira missão de Lyna é atuar disfarçada no bordel de Mama. Mas o que era para ser uma tarefa simples se complica.","air_date":"2024-03-01","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/ylB9LIQ8ooctA2E6geTy3H6yBkq.jpg","vote_average":8},"3":{"name":"Eu nunca teria apostado em você","overview":"A Fúria corre para encontrar um cofre desaparecido antes da cerimônia. Mas tudo muda quando Lyna recebe uma notícia perturbadora sobre seus pais.","air_date":"2024-03-01","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/7C88wD4Ma1O2qtqjZ4BILVEyvbe.jpg","vote_average":7.5},"4":{"name":"A Fúria é como sarna","overview":"Quando a ambição de Parques vem à tona, a Fúria pede ajuda a Fehim. Sem saber em quem confiar, Lyna procura uma forma de proteção.","air_date":"2024-03-01","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/vbCemHYSDSsg23Fknl2OJqLKf2J.jpg","vote_average":7.2},"5":{"name":"Olá, meu amor","overview":"Uma visita à prisão resulta em um grande encontro para Lyna, mas sua busca por respostas deixa um rastro de destruição.","air_date":"2024-03-01","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/8EOn1dEQs5X7IgGawgzpacVC5Ia.jpg","vote_average":7.8},"6":{"name":"A natureza abomina o vácuo","overview":"Lyna tenta prever o próximo ataque do mascarado, mas sua paciência está se esgotando. O desespero leva a uma última tentativa de restaurar a ordem.","air_date":"2024-03-01","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/Ov8kow0vCq1IBhYxN0YGZKdn88.jpg","vote_average":7.5},"7":{"name":"Onde estão as facas?","overview":"Nas sombras assustadoras de uma floresta hostil, uma aliança improvável é formada enquanto inimigos se aproximam, prontos para matar.","air_date":"2024-03-01","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/ApaHzA0wuM2oURrYkfoNpcIyNhY.jpg","vote_average":7.2},"8":{"name":"Namastê, cretino","overview":"Uma perigosa viagem de trem traz uma conclusão explosiva para a saga da família Arago. Mas a podridão continua quando novas mentiras substituem as antigas.","air_date":"2024-03-01","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/lwWnadMR5pLVmCqaMmVcpG4lyhB.jpg","vote_average":7.8}}}}},
