"106173":{"id":"106173","name":"Mundo Mistério","slug":"mundo-misterio","original_title":"Mundo Mistério","overview":"Na série, o youtuber e apresentador Felipe Castanhari explora enigmas da história e da ciência.","first_air_date":"2020-08-04","episode_run_time":25,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Felipe Castanhari"],"production_companies":[],"genres":["Documentário","Comédia","Família"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/vJVr4ZGMfqEeXfa0RYSOmy0VMl8.jpg","poster_path":"https://image.tmdb.org/t/p/original/2TDA3sIwNh3QxUcLdCeg83bDZRG.jpg","cast":["Felipe Castanhari","Guilherme Briggs","Bruno Miranda","Lilian Regina"],"trailer":"2pr2RQEUMZU","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/originalnull","backdrop_path":"https://image.tmdb.org/t/p/originalnull","air_date":"2020-08-04","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Os Mistérios do Triângulo das Bermudas","overview":"Com ajuda da Dra. Tay e do computador Briggs, Castanhari lança luz sobre o mistério da região conhecida pelo desaparecimento de navios e aviões.","air_date":"2020-08-04","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/hK9gKVHnXMDMvWqkTcyTWrfXDOb.jpg","vote_average":0},"2":{"name":"Os 20 milhões de mortos da Grande Peste","overview":"Milhões de mortos. Cidades devastadas. A primeira quarentena da história. Castanhari mostra como a Grande Peste assolou a Europa na Idade Média.","air_date":"2020-08-04","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/mjiJsWcJy0cngXo8PELkUv3Nt7a.jpg","vote_average":0},"3":{"name":"Aprendendo a viajar no tempo","overview":"Como o espaço, o tempo e a gravidade se relacionam? Castanhari explora a ciência por trás da viagem no tempo.","air_date":"2020-08-04","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/kXzUa7eOlu27idR9O1ms49MowiH.jpg","vote_average":0},"4":{"name":"Do lobo ao cão","overview":"Nos Estados Unidos, Felipe vai ao santuário Shy Wolf para descobrir como alguns lobos se aproximaram dos humanos e deram origem aos cães há milhares de anos.","air_date":"2020-08-04","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/p480A9qdhsFHfNIq9pK7Xd7IlUq.jpg","vote_average":0},"5":{"name":"Apocalipse Zumbi. E se fosse real?","overview":"Castanhari apresenta criaturas devoradoras de carne que se comportam como zumbis. Betinho fica de cabelo em pé com um experimento da Dra. Tay.","air_date":"2020-08-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dVKA6dpwQGPBomRt8zaSxB8RkPc.jpg","vote_average":0},"6":{"name":"A Grande Extinção","overview":"Será que os humanos podem desaparecer do planeta como os dinossauros? A Terra está enfrentando mais uma onda de extinção em massa? A turma do laboratório investiga.","air_date":"2020-08-04","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/m1ro3B379HidRdK2lHctjoFuIR2.jpg","vote_average":0},"7":{"name":"O caminho para a Superinteligência Artificial","overview":"A superinteligência artificial não é mais uma realidade distante. Será que um dia computadores como o Briggs poderão se virar contra nós?","air_date":"2020-08-04","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/7Dp9NKgZaHWczLPNnZekNVb5Qx6.jpg","vote_average":0},"8":{"name":"Aquecimento Global. Uma grande conspiração?","overview":"Se a Terra já enfrentou mudanças climáticas antes, o aquecimento global é mesmo tão preocupante? A equipe tenta esclarecer o tema para um convidado muito especial.","air_date":"2020-08-04","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/5rDFOllxDeS0XgwVIym3f1uTr5D.jpg","vote_average":0}}}}},
